<script nonce="<?php echo esc_attr(CSP_NONCE); ?>">
  jQuery(function() {
    var $slides = jQuery('.slide');
    var $accordionItems = jQuery('.accordion-item');
    var slideInterval;
    var slideDuration = 8000;

    $slides.first().addClass('active');
    $slides.last().addClass('prev');
    $slides.eq(1).addClass('next');
    $accordionItems.first().addClass('active');

    function setActiveSlide(slideIndex) {
      clearInterval(slideInterval);
      $slides.removeClass('active prev next').find('.patch').fadeOut();
      $accordionItems.removeClass('active').find('.loading-bar .progress').stop(true).css('width', 0);

      var activeSlide = $slides.eq(slideIndex);
      var prevSlide = $slides.eq((slideIndex - 1 + $slides.length) % $slides.length);
      var nextSlide = $slides.eq((slideIndex + 1) % $slides.length);
      activeSlide.addClass('active').find('.patch').delay(800).fadeIn();
      prevSlide.addClass('prev');
      nextSlide.addClass('next');
      $accordionItems.eq(slideIndex).addClass('active');

      slideInterval = setInterval(function() {
        setActiveSlide((slideIndex + 1) % $slides.length);
      }, slideDuration);

      jQuery('.accordion-item.active .loading-bar .progress').animate({
        width: '100%'
      }, slideDuration, 'linear');
    }

    setActiveSlide(0);

    jQuery('.slideshow').on('click', '.next', function() {
      var nextIndex = (jQuery('.slide.active').index() + 1) % $slides.length;
      setActiveSlide(nextIndex);
    });

    jQuery('.slideshow').on('click', '.prev', function() {
      var prevIndex = (jQuery('.slide.active').index() - 1 + $slides.length) % $slides.length;
      setActiveSlide(prevIndex);
    });

    jQuery('.accordion').on('click', '.accordion-title', function() {
      var $accordionItem = jQuery(this).closest('.accordion-item');
      var accordionIndex = $accordionItems.index($accordionItem);
      setActiveSlide(accordionIndex);
      console.log(accordionIndex);
    });
  });
</script>